import React from 'react';
import list from '../Data/Data';
import '../styles/amazon.css';
import Cards from './Cards';

const Amazon = ({ handleClick }) => {
  return (
    <section>
      {
        list.map((item) => (
          <Cards item={item} key={item.id} handleClick={handleClick} />
        ))
      }
    </section>
  )
}

export default Amazon
